import React, { Component } from "react";
import LeadScrapForm from "./LeadScrapForm";

export default class LeadScrap extends Component {
    onSubmit = formValues => {
        this.props.scrapeLeads(formValues);
    };
    render() {
        return (
            <div>
                <LeadScrapForm onSubmit={this.onSubmit} />
            </div>
        );
    }
}
